import React, { useState, useEffect } from "react";
import AOS from "aos";
import "aos/dist/aos.css";
import "../assets/styles/Home.css";

const Home = () => {
  //const [currentImage, setCurrentImage] = useState(0);
  const [currentImage, setCurrentImage] = useState(0);

  const carouselImages = ["/images/slide1.jpg", "/images/slide2.jpg", "/images/slide3.jpg","/images/slide3.jpg"];

  const carouselData = [
  {
    image: "/images/slide1.jpg",
    title: "Relax in Pure Bliss",
    description: "Experience unmatched serenity with our signature spa rituals."
  },
  {
    image: "/images/slide2.jpg",
    title: "Luxury Redefined",
    description: "Indulge in our premium massage therapies curated just for you."
  },
  {
    image: "/images/slide3.jpg",
    title: "Nature’s Healing Touch",
    description: "Rejuvenate with aroma oils and herbal infusions."
  },
  {
    image: "/images/slide4.jpg",
    title: "Feel the Difference",
    description: "From deep tissue to Thai massage, we tailor the experience."
  }
];


  useEffect(() => {
    AOS.init({ duration: 1000 });
  }, []);

  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentImage((prev) => (prev + 1) % carouselImages.length);
    }, 5000);
    return () => clearInterval(interval);
  }, []);

  const handleCarouselClick = (index) => {
    setCurrentImage(index);
  };

  const services = [
    { name: "Dry Massage", price: "1500", desc: "Traditional dry therapy." },
    { name: "Aroma Oil Massage", price: "2000", desc: "Calm with essential oils." },
    { name: "Cream Massage", price: "2500", desc: "Soothing cream touch." },
    { name: "Mintjel Massage", price: "2500", desc: "Cool mint therapy." },
    { name: "Chocolate Massage", price: "3000", desc: "Sweet stress relief." },
    { name: "Deep Tissue Massage", price: "3000", desc: "Relieve deep tension." },
    { name: "Thai Massage", price: "4000", desc: "Classic Thai technique." },
    { name: "Hand Massage", price: "4000", desc: "Focused hand healing." }
  ];

  return (
    <div className="home">
      <div className="carousel" data-aos="fade-down">
        <img src={carouselImages[currentImage]} alt={`slide-${currentImage}`} className="carousel-image" />
        <div className="carousel-nav">
          {carouselImages.map((_, index) => (
            <button key={index} className={`carousel-btn ${currentImage === index ? "active" : ""}`} onClick={() => handleCarouselClick(index)}></button>
          ))}
        </div>
      </div>

      <section className="services" data-aos="fade-up">
        <h2 className="section-title">Our Services</h2>
        <div className="service-grid">
          {services.map((service, index) => (
            <div key={index} className="service-card" data-aos="zoom-in-up">
              <h3>{service.name}</h3>
              <p>{service.desc}</p>
              <span>₹ {service.price}</span>
            </div>
          ))}
        </div>
      </section>

      <section className="offers" data-aos="zoom-in">
        <h2 className="section-title">Special Offers</h2>
        <p className="offer-description">Enjoy our limited-time spa packages starting at ₹1199!</p>
      </section>

      <section className="about" data-aos="fade-right">
        <h2 className="section-title">About Us</h2>
        <p>
          Midnight Spa is your ultimate destination for relaxation and rejuvenation. 
          Offering various soothing therapies including Dry Massage, Aroma Oil Massage, 
          and more, our spa ensures you leave feeling refreshed and revitalized.
        </p>
      </section>

      <section className="three-image-carousel" data-aos="fade-left">
        <div className="carousel-row">
          <img src="/images/c.jpg" alt="img1" className="carousel-slide" />
          <img src="/images/d.jpg" alt="img2" className="carousel-slide" />
          <img src="/images/c.jpg" alt="img3" className="carousel-slide" />
          <img src="/images/c.jpg" alt="img3" className="carousel-slide" />
        </div>
      </section>

      <section className="contact" data-aos="fade-up">
        <h2 className="section-title">Contact Us</h2>
        <form className="contact-form">
          <input type="text" placeholder="Your Name" />
          <input type="email" placeholder="Your Email" />
          <textarea placeholder="Your Message"></textarea>
          <button type="submit">Send Message</button>
        </form>
      </section>

      <footer className="footer" data-aos="fade-up">
        <p>© 2025 Midnight Spa - All Rights Reserved</p>
      </footer>
    </div>
  );
};

export default Home;
